import React from 'react';

const ElementaryBox = () => {
    const boxStyle = {
        width: '1154px',
        height: '216px',
        position: 'absolute',
        top: '50%',
        left: '139px',
        right: '1293px',
        transform: 'translateY(-50%)',
        border: '1px solid #000', // Пример рамки для наглядности
    };

    return (
        <div style={boxStyle}>
            <h1>ELEMENTARY</h1>
            <p>Расскажи о семье, что ты любишь и о своём лучшем друге!</p>
        </div>
    );
};

export default ElementaryBox;
